import React from "react";

type SlideProps = {
  numberSlide: number;
  setNumberSlide: (number: number) => void;
};

const MySoftSkills: React.FC<SlideProps> = ({
  numberSlide,
  setNumberSlide,
}) => {
  return (
    <>
      <div className="slider-container header px-4 w-[100%]">
        <div className="wrapper">
          <h2 className="text-5xl my-8 text-center greeting font-medium ">
            My Soft Skills
          </h2>
        </div>
        <p className="text-center my-8 mx-8 text-description">
          I will try, without unnecessary boasting, to describe the qualities
          that I believe I am endowed with
        </p>
        <div className="table-row my-4 col-2 text-lg">
            <div className="table-wrapper">
              <div className="left-col font-medium">
                <div className="softskills-wrapper">
                communication skills with people
                </div>
                
                </div>
              <div className="right-col">
                Completed German course (First steps in Germany) (A1.1)
              </div>
            </div>
            
          </div>

        <div className="icons">
          <div className="icon">
            <button
              className="hero-button px-2 py-2 rounded"
              onClick={() => setNumberSlide(3)}
            >
              <i className="fa-solid fa-arrow-left"></i>&nbsp;Who I Was
            </button>
          </div>
          <div className="icon">
            <button
              className="hero-button px-2 py-2 rounded"
              onClick={() => setNumberSlide(1)}
            >
              What I Know &nbsp;<i className="fa-solid fa-arrow-right"></i>
            </button>
          </div>
        </div>
      </div>
    </>
  );
};

export default MySoftSkills;
